import { TextHeading1, TextHeading2 } from "components/Text/TextStyles";

const Text = ({ variant, children }: TextProps) => {
	return (
		<>
			{console.log(variant)}

			{(variant = "h1") ? (
				<TextHeading1>{children}</TextHeading1>
			) : (
				<TextHeading2>{children}</TextHeading2>
			)}
		</>
	);
};

export default Text;
